import * as React from 'react';
import './dropdown.scss';

type Submenu = {
  title: string;
  submenus?: Submenu;
}[];

type DropDownProps = {
  // submenus: {
  //   title: string;
  // }[];
  submenus: Submenu;
  dropdown: boolean;
};

const Dropdown: React.FC<DropDownProps> = ({ submenus, dropdown }) => {
  return (
    <ul className={`dropdown ${dropdown ? 'dropdown-show' : ''}`}>
      {submenus.map(({ title }) => (
        <li className="item" key={title}>
          <a href="/#">{title}</a>
        </li>
      ))}
    </ul>
  );
};

export { Dropdown };
